import React, { useState } from 'react';
import '../App.css';
import { Menu, Grid, Image, Container, Header, Search } from 'semantic-ui-react';

const BuscarGrupos = () => {
	const [ sesion_usuario, setSesion_usuario ] = useState('');

	return (
		<Container>
			<Header style={{ MarginLeft: '300px', MarginTop: '200px' }} as="h1">
				Buscar Grupos
			</Header>
			<Grid>
				<Grid.Column width={2}>
					<Search />
				</Grid.Column>
			</Grid>
		</Container>
	);
};

export default BuscarGrupos;
